import React from 'react';
import ReactPlayer from 'react-player';
import './YoutubeEmbed.css';

const BTSYoutube = () => (
        <div className="Player">
            <ReactPlayer
            url="https://www.youtube.com/watch?v=S8GpX3SAeig"
            controls="on"
            width="650px"
            height="365.625px"
            volume="0.6" />
        </div>
);

export default BTSYoutube;
